import React, { useState } from "react";
import { useEffect } from "react";
import Cards from "../../components/Cards";
import Navbar from "../../components/Navbar";

const MyWebinar = () => {
  const [myWebinarList, setMyWebinarList] = useState([]);
 const {user} = useContext(second)

  useEffect(() => {
    const fetchData = async () => {
      try {
        const response = await fetch(
          `http://localhost:3003/posts?favourited=1&author=userId`
          //   {{url}}/posts?favourited=1&author=userId
        );
        const json = await response.json();
        setMyWebinarList(json?.data);
      } catch (error) {
        console.log(error);
      }
    };
    fetchData();
  }, []);

  return (
    <div>
      <Navbar />
      <Cards />
    </div>
  );
};

export default MyWebinar;
